const FrcDt = (probs) => {
    
    let dtdiv1Tag = [...probs.frcDt];
    //console.log("frcDt",dtdiv1Tag);

    dtdiv1Tag = dtdiv1Tag.map((v) => 
        <div className='dtdiv1'>{v}</div>)
    return (
        <div className="mainbox1">
            {dtdiv1Tag}
        </div>
    );
}
